function mockyController($scope,$http){$http.get("mocky.json").success(function(response){$scope.thumb=response.thumb,$scope.name=response.name,$scope.profession=response.profession,$scope.profile_title=response.profile.title,$scope.profile_description=response.profile.description,$scope.objective_title=response.objective.title,$scope.objective_description=response.objective.description;var personal=[],listPersonal=[];for(personal=response.personalSkill,i=0;i<Object.keys(personal).length;i++)listPersonal[i]='<span class="titleSkill">'+Object.keys(personal)[i]+'</span><div id="barStatus"><span id="loadSkill" style="width:'+Object.values(personal)[i]+'%"></span></div>';listPersonal.shift(),document.getElementById("skills").innerHTML=listPersonal.join(""),personal=response.personalSkill,$scope.personalSkill_title=response.personalSkill.title,$scope.personalSkill_management=response.personalSkill.management,$scope.contactMe_title=response.contactMe.title,$scope.contactMe_address=response.contactMe.address,$scope.contactMe_tel=response.contactMe.tel,$scope.contactMe_email=response.contactMe.email,$scope.contactMe_webSite=response.contactMe.webSite,$scope.education_title=response.education.title;var educacao=[],listEducacao=[];for(educacao=response.education,qtdCursos=Object.keys(Object.values(educacao.university)).length,todosCursos=educacao.university,i=0;i<qtdCursos;i++)mes=todosCursos[i].month,ano=todosCursos[i].year,nome=todosCursos[i].courseName,universidade=todosCursos[i].universityName,cidade=todosCursos[i].universityCity,descricao=todosCursos[i].description,listEducacao[i]="<span class='mes'>"+mes+"</span><span class='ano'>"+ano+"</span><h3 class='nome'>"+nome+"</h3><p class='universidade'>"+universidade+", "+cidade+"</p><p class='descricao'>"+descricao+"</p>";document.getElementById("educacao").innerHTML=listEducacao.join(""),$scope.experience_title=response.experience.title;var experiencia=[],listExperiencia=[];for(experiencia=response.experience,qtdExp=Object.keys(Object.values(experiencia.company)).length,todasExp=experiencia.company,i=0;i<qtdExp;i++)mes=todasExp[i].month,ano=todasExp[i].year,nome=todasExp[i].companyName,universidade=todasExp[i].roleName,cidade=todasExp[i].companyCity,descricao=todasExp[i].description,listExperiencia[i]="<span class='mes'>"+mes+"</span><span class='ano'>"+ano+"</span><h3 class='nome'>"+nome+"</h3><p class='universidade'>"+universidade+", "+cidade+"</p><p class='descricao'>"+descricao+"</p>";document.getElementById("experiencia").innerHTML=listExperiencia.join(""),$scope.professionalSkill_title=response.professionalSkill.title;var profissional=[],listProfissional=[];for(profissional=response.professionalSkill.tools,i=0;i<Object.keys(profissional).length;i++)listProfissional[i]='<span class="titleSkill">'+Object.values(Object.values(profissional)[i])[0]+'</span><div id="pbarStatus"><span id="ploadSkill" style="width:'+Object.values(Object.values(profissional)[i])[1]+'%"></span></div>';document.getElementById("pskills").innerHTML=listProfissional.join(""),$scope.award_title=response.award.title;var listPremios=[];response.award,qtdPremios=response.award,todosPremios=response.award,console.log(todosPremios.month),listPremios[i]="<span class='mes'>"+todosPremios.month+"</span><span class='ano'>"+todosPremios.year+"</span><h3 class='nome'>"+todosPremios.awardName+"</h3><p class='universidade'>"+todosPremios.projectName+", "+todosPremios.city+"</p><p class='descricao'>"+todosPremios.description+"</p>",document.getElementById("premios").innerHTML=listPremios.join("")})}